    def add_new_json_url(self):
        text, ok = QInputDialog.getText(self, 'New Json URL', 'Please enter the new JSON URL')
        if ok:
            if str(text):
                self.configs["json_urls"].append(str(text))
                self.update_configs_file()
                self.update_json_source_urls()
            return str(text)
        else:
            return None

    def get_configs(self):
        with open("config.json", "r") as json_file:
            self.configs = json.load(json_file)

    def update_configs_file(self):
        with open("config.json", "w") as json_file:
            json.dump(self.configs, json_file, indent=2)

    def update_json_source_urls(self):
        for i, url in enumerate(self.configs["json_urls"]):
            print(i, url)
            self.json_source_url_combobox.setItemText(i, url)
        self.json_source_url_combobox.setMaxVisibleItems(10)

    def get_social_media_custom_text(self):
        return self.social_media_custom_text_edit.toPlainText()

    def set_social_media_custom_text(self):
        self.social_media_custom_text_edit.insertPlainText(self.configs["social_media_custom_text"])

    def get_social_media_checkboxes(self):
        return {
            "EventName": self.event_name_checkbox.isChecked(),
            "StartTime": self.start_time_checkbox.isChecked(),
            "ShortDescription": self.short_description_checkbox.isChecked(),
            "Description": self.description_checkbox.isChecked(),
            "CreationDate": self.creation_date_checkbox.isChecked(),
            "PurchasePageLink": self.purchase_page_link_checkbox.isChecked(),
            "SpeakersName": self.speakers_name_checkbox.isChecked(),
            "SpeakersBio": self.speakers_bio_checkbox.isChecked(),
            "Duration": self.duration_checkbox.isChecked(),
        }

    def set_social_media_checkboxes(self):
        self.event_name_checkbox.setChecked(self.configs["social_media_checkboxes"]["EventName"])
        self.start_time_checkbox.setChecked(self.configs["social_media_checkboxes"]["StartTime"])
        self.short_description_checkbox.setChecked(self.configs["social_media_checkboxes"]["ShortDescription"])
        self.description_checkbox.setChecked(self.configs["social_media_checkboxes"]["Description"])
        self.creation_date_checkbox.setChecked(self.configs["social_media_checkboxes"]["CreationDate"])
        self.purchase_page_link_checkbox.setChecked(self.configs["social_media_checkboxes"]["PurchasePageLink"])
        self.speakers_bio_checkbox.setChecked(self.configs["social_media_checkboxes"]["SpeakersBio"])
        self.speakers_name_checkbox.setChecked(self.configs["social_media_checkboxes"]["SpeakersName"])
        self.duration_checkbox.setChecked(self.configs["social_media_checkboxes"]["Duration"])

    def get_social_media_date_ranges(self):
        return self.social_media_date_range_start.dateTime().toPyDateTime(),\
               self.social_media_date_range_end.dateTime().toPyDateTime()

    def get_post_before_date(self):
        return {
            "months": self.post_before_months.value(),
            "weeks": self.post_before_weeks.value(),
            "days": self.post_before_days.value()
        }

    def get_post_in_social_media(self):
        return {
            "facebook": self.post_in_facebook_checkbox.isChecked(),
            "twitter": self.post_in_twitter_checkbox.isChecked(),
            "linkedin": self.post_in_linkedin_checkbox.isChecked()
        }

    def social_media_save(self):
        self.configs["post_in"] = self.get_post_in_social_media()
        self.configs["post_before"] = self.get_post_before_date()
        self.configs["start_date_calendar"] = str(self.get_social_media_date_ranges()[0])
        self.configs["end_date_calendar"] = str(self.get_social_media_date_ranges()[1])
        self.configs["social_media_checkboxes"] = self.get_social_media_checkboxes()
        self.configs["social_media_custom_text"] = self.get_social_media_custom_text()
        self.update_configs_file()

    def load_tab(self, tab_index):
        if tab_index == 0:
            self.set_social_media_checkboxes()
            self.set_social_media_custom_text()


